function substrCount(n, s) {
    let unicos = n; //casos unicos
    let simetricos = 0;
    let sequenciais = 0;
    for (let i = 1; i < n; i++){
        let j =1;
        let vizinho = s[i+1];
        while (s[i-j]== vizinho && s[i+j] == vizinho && s[i]!=vizinho && i-j>=0 && i+j<n){
            simetricos++;
            j++;
        }
        j=1;
        while (s[i]==s[i+j] && i+j<n){
            sequenciais++;
            j++;
        }
        if (s[i]==s[i-1]) unicos++;
    }
    console.log(`unicos: ${unicos}, simetricos: ${simetricos}, sequenciais: ${sequenciais}`);
    let counter = unicos+simetricos+sequenciais;
    return counter;


}

let s = '';

console.log (substrCount(s.length, s));
